import React from "react";

function LoginPage() {
  return (
    <div className="grid place-items-center relative ">
      <div
        style={{ backgroundImage: `url('/images/background.svg')` }}
        className=" flex flex-col items-center justify-center z-10 px-10 h-screen max-w-[390px] "
      >
        <div>
          <img src="/images/HigherEducationLogo.svg" />
        </div>
        <p className="text-[40px] text-white mt-3 text-center">PROJECT KARMA</p>
        <p className="font-family text-[20px] font-normal text-[#fff]">
          Get rewarded for
        </p>
        <p className="font-family text-[#fff] text-[20px] font-normal">
          telling us what you think.
        </p>
        <button className="w-[263px] h-[47px] rounded-[15px] bg-[#3B2B2F] text-[25px] text-[#E8E7D8] font-normal mt-7">
          Scan Barcode to BEGIN
        </button>
      </div>
    </div>
  );
}

export default LoginPage;
